import React from "react";
import i from "./contactItem.css"

const Contact = ({deleteContact, contacts, goToEditMode}) => {
    return (
        <div className={i.contactItem}>
            <div>{contacts.name}</div>
            <div>{contacts.email}</div>
            <div>{contacts.phoneNumber}</div>
            <div>{contacts.position}</div>
            <button onClick={() => {deleteContact(contacts.id)}}>Delete</button>
            <button onClick={goToEditMode}>Edit</button>
        </div>
    )
}

export default Contact
